from collections import defaultdict

class Solution:
    #   Wrong Answer
    def canThreePartsEqualSum0(self, A):
        l, r = 0, len(A) - 1
        sumFromLeft, sumFromRight = A[l], A[r]
        while l + 1 < r:
            if sumFromLeft == sumFromRight == sum(A[l + 1:r]):
                return True
            if sumFromLeft < sumFromRight:
                l += 1
                sumFromLeft += A[l]
            else:
                r -= 1
                sumFromRight += A[r]
        return False

    #   Time Limit Exceeded
    def canThreePartsEqualSum1(self, A):
        _sum, d = 0, defaultdict(list)
        for i in range(len(A) - 2):
            _sum += A[i]
            d[_sum].append(i)
        _sum = 0
        for i in range(len(A) - 1, 1, -1):
            _sum += A[i]
            d[_sum].append(i)
        for _sum, idxList in d.items():
            if len(idxList) < 2:
                continue
            for i, idx1 in enumerate(idxList):
                for j in range(i + 1, len(idxList)):
                    idx2 = idxList[j]
                    if idx1 + 1 < idx2 and sum(A[:idx1 + 1]) == sum(A[idx1 + 1:idx2]) == sum(A[idx2:]):
                        return True
        return False

    #   Time Limit Exceeded
    def canThreePartsEqualSum2(self, A):
        _sum, dl = 0, defaultdict(list)
        for i in range(len(A) - 2):
            _sum += A[i]
            dl[_sum].append(i)
        _sum, dr = 0, defaultdict(list)
        for i in range(len(A) - 1, 1, -1):
            _sum += A[i]
            dr[_sum].append(i)
        for _sum, idxList in dl.items():
            for idx1 in idxList:
                for idx2 in dr[_sum]:
                    #if idx1 + 1 < idx2 and sum(A[:idx1 + 1]) == sum(A[idx1 + 1:idx2]) == sum(A[idx2:]):
                    if idx1 + 1 < idx2 and _sum == sum(A[idx1 + 1:idx2]):
                        return True
        return False

    #   runtime; 88ms, 100.00%
    #   memory; 17.9MB, 100.00%
    def canThreePartsEqualSum(self, A):
        target = sum(A) // 3
        _sum, lIdx = 0, []
        for i in range(len(A) - 2):
            _sum += A[i]
            if _sum == target:
                lIdx.append(i)
        _sum = 0
        for r in range(len(A) - 1, 1, -1):
            _sum += A[r]
            if _sum == target:
                for l in lIdx:
                    if l + 1 < r and target == sum(A[l + 1:r]):
                        return True
        return False


